// Registrar compra
describe('Register Purchase in api/purchases/registrar', function() {
    let user = {
        nombreUsuario: "TestUser",
        email: "test@email.com",
        password: "test1234",
        rol: "Usuario"
    }
    let purchase = {
        cliente: "",
        estado: "Pendiente",
        farmacia: "6734d663ae3a056aa732e92a",
        fecha: "2025-06-01T06:00:00.000Z",
        medicamento: "6734d831ae3a056aa732e92e",
        numeroFactura: 1234,
        imgFactura: {
            contentType: "image/jpeg",
            data: ""
        },
        cantidad: 1
    }
    let resultPurchase

    before(async function() {
        // Register user
        const res = await chai.request.execute(start)
            .post('/api/users/registrar')
            .send(user)
        
        // Save result user
        res.body.should.have.property('data')
        res.body.data.should.have.property('user')
        res.body.data.user.should.have.property('_id')
        purchase.cliente = res.body.data.user._id

        // Register purchase
        const res2 = await chai.request.execute(start)
            .post('/api/purchases/registrar')
            .send(purchase)

        // Get saved purchase
        res2.status.should.equal(200)
        const purchases = await chai.request.execute(start)
            .get(`/api/purchases/getPurchasesByUser/${purchase.cliente}`)
        purchases.status.should.not.equal(500)
        resultPurchase = purchases.body[0]
    })

    after(async function() {
        await User.deleteMany({})
        await Purchase.deleteMany({})
    })

    it('should save object correctly', function() {
        resultPurchase.should.have.property('cliente')
        resultPurchase.cliente.toString().should.equal(purchase.cliente)
        resultPurchase.should.have.property('estado').equal(purchase.estado)
        resultPurchase.should.have.property('imgFactura')
        resultPurchase.imgFactura.should.have.property('data')
        let imgData = Buffer.from(resultPurchase.imgFactura.data.data).toString('base64')
        imgData.should.equal(purchase.imgFactura.data)
        resultPurchase.should.have.property('farmacia')
        resultPurchase.farmacia.toString().should.equal(purchase.farmacia)
        resultPurchase.should.have.property('fecha')
        resultPurchase.fecha.toString().should.equal(purchase.fecha)
        resultPurchase.should.have.property('medicamento')
        resultPurchase.medicamento.toString().should.equal(purchase.medicamento)
        resultPurchase.should.have.property('numeroFactura').equal(purchase.numeroFactura)
        resultPurchase.should.have.property('cantidad').equal(purchase.cantidad)
    })
})

