        result2.should.have.property('medicamento')
        result2.medicamento.toString().should.equal(purchase2.medicamento)
        // fecha
        result1.should.have.property('fecha')
        result1.fecha.toString().should.equal(purchase1.fecha)
        result2.should.have.property('fecha')
        result2.fecha.toString().should.equal(purchase2.fecha)
        // imgFactura
        result1.should.have.property('imgFactura')
        result1.imgFactura.should.have.property('data')
        let imgData1 = Buffer.from(result1.imgFactura.data.data).toString('base64')
        imgData1.should.equal(purchase2.imgFactura.data)
        result2.should.have.property('imgFactura')
        result2.imgFactura.should.have.property('data')
        let imgData2 = Buffer.from(result2.imgFactura.data.data).toString('base64')
